query SiteTitleQuery {
  site {
    siteMetadata {
      title
      description
    }
  }
  file(relativePath: {regex: "/bg/"}) {
    childImageSharp {
      fluid(maxWidth: 1000) {
        ...GatsbyImageSharpFluid_tracedSVG
      }
    }
  }
}

fragment GatsbyImageSharpFluid_tracedSVG on ImageSharpFluid {
  tracedSVG
  aspectRatio
  src
  srcSet
  sizes
}

